Đoạn mã thẻ
Để bật tính năng tiếp thị lại động, bạn cần phải triển khai thẻ trang web toàn cầu cũng như đoạn mã sự kiện để theo dõi những hoạt động tương tác cụ thể trên trang web của mình. Nếu đã triển khai mã tiếp thị lại cũ, bạn nên sử dụng thẻ và đoạn mã mới.
Thẻ trang web toàn cầu
Bạn cần đặt thẻ trang web toàn cầu trên tất cả các trang của trang web, trong phần "head" của các trang HTML.

