  gtag('js', new Date());

  gtag('config', 'AW-458544154');
</script>
Đoạn mã sự kiện
Bạn nên triển khai đoạn mã sự kiện để theo dõi các hành động cụ thể của người dùng liên quan đến loại hình doanh nghiệp của bạn, chẳng hạn như xem một trang sản phẩm, bắt đầu xác nhận thông tin mua hàng hoặc hoàn thành một lượt chuyển đổi. Đoạn mã sự kiện phải được đặt sau thẻ trang web toàn cầu.

<script>
  gtag('event', 'page_view', {
    'send_to': 'AW-458544154',
    'value': 'replace with value',
    'items': [{
      'id': 'replace with value',
      'location_id': 'replace with value',
      'google_business_vertical': 'custom'
    }]
  });
</script>


Lưu ý: Bạn không nên cắt và dán trực tiếp đoạn mã sự kiện mẫu này vào mã trang web vì đoạn mã này chứa các giá trị trình giữ chỗ được điền động nhằm thu thập dữ liệu về hành động tương tác của người dùng với các sản phẩm hoặc dịch vụ của bạn. Tìm hiểu thêm về cách triển khai đoạn mã sự kiện.
